description:
Mes Voisines Sont Poilues [DVDRip]

Green Eyes, Astick, Furie, Michael, Mina, HPG

HPG inspecte la France profonde. Et le fond de culotte des Francaises. Qu'y a t'il sous leur culotte lorsqu'elles la retirent! Des touffes monstrueusement bien garnies. Des forets qui ne sont plus vierges depuis longtemps et qu'il faut defourailler avec un peigne. Quand on leur bouffe clitoune (apres l'avoir bien cherchee entre les poils) elles sont tellement excitees qu'elles coulent comme des torrents et inondent leur motte. HPG a le don pour denicher des femmes a la toison abondante et bien salopes. Il n'a pas chercher beaucoup, le plus souvent ce sont ces voisines qui se pretent au jeu. Comme la plupar des filles presentes dans ce film sont des femmes mures, on devine qu'il n'a pas beaucoup de mal a les convaincre de s'exhiber devant la camera, cela fait longtemps qu'elles ne se sont pas goinfrees de bites jeunes, alors elles accourent.

